import React, { useEffect, useState } from 'react';
import { toggleMenu } from '../utils/appSlice';
import { useDispatch, useSelector } from 'react-redux';
import { YOUTUBE_SEARCH_API } from '../utils/constants';
//import "../App.css"
const Head = () => {

const [suggestions, setSuggestions] = useState([]);
  const [serchQuery, setSearchQuery] = useState("")
   const [showSuggestions, setShowSuggestions] = useState(false);
  console.log("serchQuery", serchQuery);
  const searchCahe=useSelector(store=>store.search)
  useEffect(() => {
  //Api call on every key strocks
    //make  an api call after every key strocks 
    //decline the api call if it is <200 ms
     const getSerachSuggetons = async() => {
    const data = await fetch(YOUTUBE_SEARCH_API + serchQuery)
    const json = await data.json()
    setSuggestions(json[1])
    console.log("json",json[1]);
  }
    const timer = setTimeout(() => {
      
      if (searchCahe[serchQuery]) {
         setSuggestions(searchCahe[serchQuery])
      } else {
        getSerachSuggetons()
      }


      getSerachSuggetons()
    }, 200)
    
    return () => {
      clearTimeout(timer)
    }
},[serchQuery])

  
  
  /** 
   * 
   * 
   * 
   * 
   * 
   * 
  */
  
  
  
  
  
  
 
const dispatch=useDispatch()
    const togglehandleer = ()=>{
    dispatch(toggleMenu())
}


  return (
   <div className="grid grid-flow-col p-5 m-2 shadow-lg">
      <div className="flex col-span-1">
        <img
         onClick={ ()=>togglehandleer()}
          className="h-8 cursor-pointer"
          alt="menu"
          src="data:image/png;base64,"
        />
        <a href="/">
          <img
            className="h-8 mx-2"
            alt="youtube-logo"
            src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/YouTube_Logo_2017.svg/2560px-YouTube_Logo_2017.svg.png"
          />
        </a>
      </div>
      <div className="col-span-10 px-10">
        <input onBlur={() => setShowSuggestions(false )}
          onFocus={() => setShowSuggestions(true)} value={serchQuery} onChange={(e) => setSearchQuery(e.target.value)}
          className="w-1/2 border border-gray-400 p-2 rounded-l-full"
          type="text"
        />
        <button className="border border-gray-400 px-5 py-2 rounded-r-full bg-gray-100">
          🔍
        </button>


    {showSuggestions && (
           <div className="fixed bg-white py-2 px-2 w-[37rem] shadow-lg rounded-lg border border-gray-100">
             <ul>
               {suggestions.map((s) => (
                 <li key={s} className="py-2 px-3 shadow-sm hover:bg-gray-100">
                   🔍 {s}
                 </li>
               ))}
             </ul>
           </div>
         )}
      </div>
    

      <div className="col-span-1">
        <img
          className="h-8 "
          alt="user"
          src="https://www.iconpacks.net/icons/2/free-user-icon-3296-thumb.png"
        />
      </div>
    </div>
  );
}

export default Head;



